/* HUMAN Security telemetry library */
const BANNER_BOT    = '';
const BANNER_HUMAN  = '';
const CANVAS_WIDTH  = 730;
const CANVAS_HEIGHT = 376;
const CANVAS_RADIUS = CANVAS_WIDTH / 2;
const GAUGE_BOT     = '';
const GAUGE_HUMAN   = '';
const GAUGE_PADDING = 20;
const JITTER_PROB   = 10; /* Percent likelihood the needle will jump */
const JITTER_RANGE  = 3; /* Jitter range percentage, i.e. how much the needle jitters */
const NEEDLE_LENGTH = 300;
const NEEDLE_OFFSET = 2;
const RECORD_LIMIT  = 100;

const DIAL_SRCS = [
    `data:image/png;base64,${GAUGE_HUMAN}`,
    `data:image/png;base64,${GAUGE_BOT}`
];

let metrics = [];

/* Tracks changes to an interactivity metric over time */
class Metric {
    constructor(weight) {
        /* Weight affects how strongly a metric influences Humanity calculation */
        this._weight = weight;
        this._records = [0];
        this._uniqueness = 1;
        metrics.push(this);
    }

    record(value) {
        this._records.unshift(Math.round(value));
        if (RECORD_LIMIT < this._records.length) { this._records.pop(); }
        this._uniqueness = [...(new Set(this._records))].length
    }

    get uniqueness() { return this._uniqueness; }
    get val() { return this._records[0]; }
    get weight() { return this._weight }
}

/* Collect user statistics */
let stats = {
    mouse: {
        accel: {
            x: new Metric(1),
            y: new Metric(1)
        },
        pos: {
            x: new Metric(4.5),
            y: new Metric(4.5)
        }
    },
    scroll: {
        pos: new Metric(1)
    },
    window: {
        x: new Metric(-1),
        y: new Metric(-1)
    },
    status: BANNER_BOT,
    total: 0
}

/* Set up gauge functionality after document loads */
$(function() {
    let currentPercent = 0;

    /* Periodically measure browser telemetry */
    function update(_) {
        stats.window.x.record($(window).width());
        stats.window.y.record($(window).height());
        stats.total = metrics.reduce((prev, cur) => { return prev + cur.uniqueness * cur.weight }, 0);

        /*
         * Max possible uniqueness score is 500 so div. by 5 to get a %
         * Pad an little extra because empirically it's hard to get above 70%
         */
        currentPercent = GAUGE_PADDING + stats.total / 5;
        if (JITTER_PROB > Math.random() * 100) {
            currentPercent += Math.floor(Math.random() * JITTER_RANGE) - JITTER_RANGE / 2;
        }
        if (currentPercent > 100) { currentPercent = 100; }
        if (currentPercent < 0) { currentPercent = 0; }
        stats.banner = 50 < currentPercent ? BANNER_HUMAN : BANNER_BOT;
    }

    function drawHTML() {
        $(".human-banner").attr("src", `data:image/png;base64,${stats.banner}`);
        $(".human-mouse-acceleration").html(
            `maX: ${stats.mouse.accel.x.val} (${stats.mouse.accel.x.uniqueness}), ` +
            `maY: ${stats.mouse.accel.y.val} (${stats.mouse.accel.y.uniqueness})`
        );
        $(".human-mouse-coordinates").html(
            `mpX: ${stats.mouse.pos.x.val} (${stats.mouse.pos.x.uniqueness}), ` +
            `mpY: ${stats.mouse.pos.y.val} (${stats.mouse.pos.y.uniqueness})`
        );
        $(".human-scroll-top").html(`sp: ${stats.scroll.pos.val} (${ stats.scroll.pos.uniqueness })`);
        $(".human-window-size").html(
            `wX: ${stats.window.x.val} (${stats.window.x.uniqueness}), ` +
            `wY: ${stats.window.y.val} (${stats.window.y.uniqueness})`
        );
        $(".humanity").html(`pct: ${currentPercent}`);
    }

    function drawGaugeWedge(c, prevAngle, angle, pat) {
        /* Draw dial wedges */
        c.beginPath();
        c.lineWidth = 0;
        c.moveTo(CANVAS_RADIUS, CANVAS_RADIUS);
        c.arc(CANVAS_RADIUS, CANVAS_RADIUS, CANVAS_RADIUS, prevAngle, angle, false);
        c.lineTo(CANVAS_RADIUS, CANVAS_RADIUS);
        c.closePath();
        c.fillStyle = pat;
        c.fill();
    }

    function drawGaugeNeedle(c, angle) {
        c.beginPath();
        c.moveTo(CANVAS_RADIUS, CANVAS_RADIUS - NEEDLE_OFFSET);
        c.strokeStyle = 'white'
        c.lineWidth = 4;
        c.lineCap = 'round';
        c.lineTo(
            CANVAS_RADIUS + NEEDLE_LENGTH * Math.cos(angle),
            CANVAS_RADIUS - NEEDLE_OFFSET + NEEDLE_LENGTH * Math.sin(angle));
        c.stroke();
    }

    function drawGaugeCanvas() {
        /* Calculate size of gauge wedges */
        let totalWedges = 2;
        let gaugeSize = currentPercent/100;
        /* Gauge graphic is at most 1/2 of a circle */
        let data = [gaugeSize, totalWedges - gaugeSize];

        let canvas = document.getElementById('canvas');
        let c = canvas.getContext('2d');
        c.clearRect(0, 0, CANVAS_WIDTH, CANVAS_HEIGHT);

        let prevAngle = 1/2 * Math.PI * 2;
        for (let i = 0; i < data.length; i++) {
            /* Draw dial as two wedges, one part bot, one part human */
            let fraction = data[i] / totalWedges;
            let angle = prevAngle + fraction*Math.PI*2;
            /* Each dial wedge gets filled with either human or bot image */
            let pat = c.createPattern(imgArray[i],"no-repeat");
            drawGaugeWedge(c, prevAngle, angle, pat);

            /* Draw needle after drawing first part of dial, the "Human" wedge */
            if (0 === i) {
                drawGaugeNeedle(c, angle);
            }

            /* Update for next wedge arc */
            prevAngle = angle;
        }
    }

    /* Update screen */
    function draw() {
        drawHTML();
        drawGaugeCanvas();
    }

    /* Main animation loop */
    function loop(timestamp) {
        let progress = timestamp - lastRender;

        update(progress);
        draw();

        lastRender = timestamp;
        window.requestAnimationFrame(loop);
    }
    let lastRender = 0

    /* Kick off animation loop after capturing a few key events */
    function initLoop() {
        /* human-scroll-top */
        $(window ).scroll(function() {
            stats.scroll.pos.record($(document).scrollTop())
        });

        /* human-mouse-acceleration and human-mouse-coordinates */
        document.addEventListener("mousemove", function(e){
            stats.mouse.accel.x.record(e.movementX);
            stats.mouse.accel.y.record(e.movementY);
            stats.mouse.pos.x.record(e.pageX);
            stats.mouse.pos.y.record(e.pageY - stats.scroll.pos.val);
        }, false);

        /* Begin animation loop */
        window.requestAnimationFrame(loop);
    }

    /* Load necessary image assets before firing callback to animation loop initializer */
    function loadAllImages(callback){
        let imagesOK = 0;
        for (let i=0; i < DIAL_SRCS.length; i++) {
            let img = new Image();
            imgArray.push(img);
            img.onload = function(){
                imagesOK++;
                if (imagesOK >= DIAL_SRCS.length ) {
                    callback();
                }
            };
            img.onerror=function(){ /** Ignore **/ }
            img.crossOrigin="anonymous";
            img.src = DIAL_SRCS[i];
        }
    }

    let imgArray = [];
    loadAllImages(initLoop);
})
